import { configureStore } from '@reduxjs/toolkit';
import authReducer from '../redux/user/userSlice';
import categoryReducer from '../redux/category/categorySlice';

export const store = configureStore({
  reducer: {
    auth : authReducer,
    category : categoryReducer,
  },
});
